import React from 'react'

const Footer = () => {

    return(
    <footer>
        <hr />
        <div class="container">
            <div class="row">
                <div class="col-lg-8 col-md-10 mx-auto">
                    <p class="copyright text-muted">Copyright &copy; Your Website 2020</p>
                </div>
            </div>
        </div>
    </footer>
    )
}

export default Footer;
